import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Navbar, Nav, Alert } from 'react-bootstrap';
import Dashboard from './components/Dashboard';
import AgentStatus from './components/AgentStatus';
import InventoryView from './components/InventoryView';
import SustainabilityMetrics from './components/SustainabilityMetrics';
import { SocketProvider } from './contexts/SocketContext';
import './App.css';

function App() {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [alerts, setAlerts] = useState([]);

  useEffect(() => {
    // Simulate some initial alerts
    setAlerts([
      { id: 1, type: 'info', message: 'System initialized successfully', timestamp: new Date() },
      { id: 2, type: 'warning', message: 'Demand spike detected for SKU001', timestamp: new Date() },
    ]);
  }, []);

  const addAlert = (type, message) => {
    const newAlert = {
      id: Date.now(),
      type,
      message,
      timestamp: new Date()
    };
    setAlerts(prev => [newAlert, ...prev.slice(0, 9)]); // Keep last 10 alerts
  };

  const removeAlert = (id) => {
    setAlerts(prev => prev.filter(alert => alert.id !== id));
  };

  const renderContent = () => {
    switch (activeTab) {
      case 'dashboard':
        return <Dashboard addAlert={addAlert} />;
      case 'agents':
        return <AgentStatus addAlert={addAlert} />;
      case 'inventory':
        return <InventoryView addAlert={addAlert} />;
      case 'sustainability':
        return <SustainabilityMetrics addAlert={addAlert} />;
      default:
        return <Dashboard addAlert={addAlert} />;
    }
  };

  return (
    <SocketProvider>
      <div className="App">
        <Navbar bg="dark" variant="dark" expand="lg" className="mb-4">
          <Container>
            <Navbar.Brand href="#">
              🤖 Autonomous Inventory Orchestrator
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link 
                  active={activeTab === 'dashboard'} 
                  onClick={() => setActiveTab('dashboard')}
                >
                  Dashboard
                </Nav.Link>
                <Nav.Link 
                  active={activeTab === 'agents'} 
                  onClick={() => setActiveTab('agents')}
                >
                  Agents
                </Nav.Link>
                <Nav.Link 
                  active={activeTab === 'inventory'} 
                  onClick={() => setActiveTab('inventory')}
                >
                  Inventory
                </Nav.Link>
                <Nav.Link 
                  active={activeTab === 'sustainability'} 
                  onClick={() => setActiveTab('sustainability')}
                >
                  Sustainability
                </Nav.Link>
              </Nav>
              <Navbar.Text>
                <span className="status-indicator active"></span>
                System Online
              </Navbar.Text>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <Container fluid>
          {/* Alert System */}
          <Row>
            <Col>
              {alerts.map(alert => (
                <Alert 
                  key={alert.id} 
                  variant={alert.type === 'error' ? 'danger' : alert.type}
                  dismissible
                  onClose={() => removeAlert(alert.id)}
                  className="alert-message"
                >
                  <strong>{alert.type.toUpperCase()}:</strong> {alert.message}
                  <small className="text-muted d-block">
                    {alert.timestamp.toLocaleTimeString()}
                  </small>
                </Alert>
              ))}
            </Col>
          </Row>

          {/* Main Content */}
          <Row>
            <Col>
              {renderContent()}
            </Col>
          </Row>
        </Container>
      </div>
    </SocketProvider>
  );
}

export default App;
